// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract EventSignup {
    struct Event {
        string name;
        string description;
        uint256 maxCapacity;
        uint256 signupStartTime;
        uint256 signupEndTime;
        uint256 redemptionTime;
        address creator;
        uint256 attendeeCount;
    }

    Event public eventDetails;
    mapping(address => bool) public attendees;

    event SignedUp(address indexed attendee);
    event EventCreated(string name, uint256 maxCapacity, uint256 signupStartTime, uint256 signupEndTime, uint256 redemptionTime);

    modifier withinSignupPeriod() {
        require(block.timestamp >= eventDetails.signupStartTime, "Signup has not started yet");
        require(block.timestamp <= eventDetails.signupEndTime, "Signup has ended");
        _;
    }

    modifier withinCapacity() {
        require(eventDetails.attendeeCount < eventDetails.maxCapacity, "Event is full");
        _;
    }

    modifier notSignedUp() {
        require(!attendees[msg.sender], "Already signed up");
        _;
    }

    modifier validTimes(uint256 _signupStartTime, uint256 _signupEndTime, uint256 _redemptionTime) {
        require(_signupStartTime < _signupEndTime, "Signup start time must be before signup end time");
        require(_signupEndTime < _redemptionTime, "Signup end time must be before redemption time");
        _;
    }

    constructor(
        string memory _name,
        string memory _description,
        uint256 _maxCapacity,
        uint256 _signupStartTime,
        uint256 _signupEndTime,
        uint256 _redemptionTime
    ) validTimes(_signupStartTime, _signupEndTime, _redemptionTime) {
        require(_maxCapacity > 0, "Capacity must be greater than 0");

        eventDetails = Event({
            name: _name,
            description: _description,
            maxCapacity: _maxCapacity,
            signupStartTime: _signupStartTime,
            signupEndTime: _signupEndTime,
            redemptionTime: _redemptionTime,
            creator: msg.sender,
            attendeeCount: 0
        });

        emit EventCreated(_name, _maxCapacity, _signupStartTime, _signupEndTime, _redemptionTime);
    }

    function signUp() external withinSignupPeriod withinCapacity notSignedUp {
        attendees[msg.sender] = true;
        eventDetails.attendeeCount++;
        emit SignedUp(msg.sender);
    }
}

